if(inputVelocity == 0) {
    outputColor = [0 , 88];
} else {
    inputVelocity = inputVelocity.toString(2);
    inputVelocity = inputVelocity.padStart(6 , 0);
    for(let i = 0 ; i < inputVelocity.length ; i++) {
        if( inputVelocity[i] == 1 ) {
            switch (i) {
                case 0:
                    mixColor[1] += 2;
                break;
                case 1:
                    mixColor[1] += 1;
                break;
                case 2:
                break;
                case 3:
                break;
                case 4:
                    mixColor[0] += 2;
                break;
                case 5:
                    mixColor[0] += 1;
                break;
                default:
                // Nothing forecasted in here
            }
        }
    } if (mixColor[1] === mixColor[0] && mixColor[0] === 0 ) {
        outputColor = [0 , 88];
    } else if (mixColor[1] === 0) {
        outputColor[0] = 0;
        switch (mixColor[0]) {
            case 3:
                outputColor[1] = 50;
            break;
            case 2:
                outputColor[1] = 40;
            break;
            case 1:
                outputColor[1] = 20;
            break;
        }
    } else if (mixColor[0] === 0) {
        outputColor[0] = 120;
