            case 3:
                outputColor[1] = 50;
            break;
            case 2:
                outputColor[1] = 40;
            break;
            case 1:
                outputColor[1] = 20;
            break;
        }
    } else if (mixColor[0] === mixColor[1]){
        outputColor[0] = 60;
        switch (mixColor[1]) {
            case 3:
                outputColor[1] = 50;
            break;
            case 2:
                outputColor[1] = 43.3;
            break;
            case 1:
                outputColor[1] = 30;
            break;
        }
    } else if (mixColor[0] !==  mixColor[1]) {
        outputColor[1] = 50;
    let colorDif = mixColor[0] - mixColor[1];
