            case 2:
                outputColor[0] = 36;
            break;
            case 1:
                outputColor[0] = 41.5;
            break;
            case -1:
                outputColor[0] = 78.5;
            break;
            case -2:
                outputColor[0] = 84;
            break;
        }
    }
}
